import React from 'react';

const About = () => {
  return <div>
    <h1>PRIVACY NOTICE</h1>
    <p>
      This is privacy notice for Othman (" Company," "we," "us," or "our" )
      describes how and why we might collect, store, use, and/or share ("process") 
      your information when you use our services ("Services"), such as when you:
    </p>
    <ul>
  <li>Download and use our mobile application ( Zakarni) , or any other application of ours that links to this privacy notice</li>
  <li>Tea</li>
  <li>Milk</li>
</ul> 
    </div>;
};

export default About;
